        },
        {
            id: 6,
            imgSrc: '',

        },
    ]
    
    return (
        

<div class="gal">
    {
        gData.map((i) => <img src={i.src} alt="gallery"/>)
    }
        
    </div>
  

    )
}
export default Gallery
